import '../styles/ExamCard.css'

const ExamCard = (props) => { 

    
    const{id, score, trainee} = props.ExamResult
    
    
    
   return(
        <div className="traineeCard">
            <div className="traineedetails">
                <h2>{trainee.name}</h2>
                <span className='details'> {score}</span> <br/>
                {score.map(scores=> {
                    return(
                        <span key="trainee.id"> {score} </span>
                    )
                })}
            </div>
           
        </div>

    )
}

export default ExamCard
